import { Breadcrumb } from "flowbite-react";
import { HomeIcon } from '@heroicons/react/24/solid'
import useBreadcrumbs from "use-react-router-breadcrumbs";
import {useLinkClickHandler, useLocation} from "react-router-dom";

const routes = [
    { path: "/", breadcrumb: "Главная" },
    { path: "/100nouns", breadcrumb: "100 Существительных" },
  ];

export default function(){
    const breadcrumbs = useBreadcrumbs(routes);
    return (
        <Breadcrumb aria-label="Default breadcrumb example" className="m-2 my-4">
            {/*<Breadcrumb.Item href="#" icon={HomeIcon}> Главная </Breadcrumb.Item> */}
            {breadcrumbs.map(({ breadcrumb, match }) => {
                return (
                    <span><Breadcrumb.Item icon={match.pathname === '/' ? HomeIcon : undefined} key={match.pathname} href={match.pathname}> {breadcrumb} </Breadcrumb.Item></span>
                )
            })}

        </Breadcrumb>
    )
}
